import React from 'react';
import FilterExpansionsModule from './FilterExpansionsModule';
import TableModule from './TableModule';
import axios from 'axios';
import {Router, Route, Link } from "react-router-dom";
import Grid from '@material-ui/core/Grid';



export default class ChangeGoalsPage extends React.Component {


    render() {
        return (
            <div>
                <Grid container justify="center">
                    <h1>Change your goals below!</h1>
                </Grid>
                <Grid container justify="center" alignItems="center">
                    <h2>Current Goals:</h2>
                </Grid>
                <Grid container justify="space-around" alignItems="center">
                    <Grid item><u>{this.props.match.params.calorie_goal}</u></Grid>
                    <Grid item></Grid>
                    <Grid item></Grid>
                    <Grid item></Grid>
                </Grid>
                <Grid container justify="center" alignItems="center">
                    <Grid item></Grid>
                    <Grid item></Grid>
                    <Grid item></Grid>
                    <Grid item></Grid>
                </Grid>

                <div>{this.props.match.params.id}</div>
                <div>{this.props.match.params.fullname}</div>
                <div>{this.props.match.params.calorie_goal}</div>
                <div>{this.props.match.params.protein_goal}</div>
                <div>{this.props.match.params.fats_goal}</div>
                <div>{this.props.match.params.carbs_goal}</div>
            </div>
        );
    }
}
